def generate_logo(ticker):
    # Создаем новое изображение размером 100x100 пикселей и белым фоном
    image = Image.new("RGB", (640, 640), (71, 80, 95))

    # Создаем объект для рисования на изображении
    draw = ImageDraw.Draw(image)

    # Определяем размер и шрифт текста
    font_size = 320
    font = ImageFont.truetype("C:\Windows\Fonts\Roboto-Bold.ttf", font_size)

    # Определяем координаты центра изображения
    center_x = image.width // 2
    center_y = image.height // 2.5

    # Получаем первую букву Ticker'а
    first_letter = ticker[0].upper()

    # Определяем ограничивающий прямоугольник для текста
    text_bbox = draw.textbbox((0, 0), first_letter, font=font)

    # Определяем координаты верхнего левого угла текста, чтобы он был по центру изображения
    text_x = center_x - (text_bbox[2] - text_bbox[0]) // 2
    text_y = center_y - (text_bbox[3] - text_bbox[1]) // 2

    # Рисуем текст на изображении
    draw.text((text_x, text_y), first_letter, fill="white", font=font)

    # Сохраняем изображение с именем Ticker.png
    image.save(f"photos/{ticker}.png")
    return ''

def save_photo(url, ticker):
    response = requests.get(url)
    file_name = f"photos/{ticker}.png"
    with open(file_name, 'wb') as file:
        file.write(response.content)


